              veritatis ipsa? Dicta eligendi id hic aperiam similique.
            </p>
          </div>
        </div>
      </div>

      <div className="container py-5 text-center">
        <h2 className="display-4 pb-4">Categories</h2>
        {
          categories && console.log(categories)
          // Object.keys(categories).forEach((value) => {
          //   let data = "";
          //   return (
          //     <button type="button" className="btn btn-orange rounded-pill">
          //       {value.categoryName}
          //     </button>
          //   );
          // })
        }
        <button
          type="button"
          className="btn btn-orange rounded-pill"
          onClick={() => console.log(categories)}
        >
          Mobile
        </button>
        <button type="button" className="btn btn-orange rounded-pill">
          Headphones
        </button>
        <button type="button" className="btn btn-orange rounded-pill">
          Computers
        </button>
        <button type="button" className="btn btn-orange rounded-pill">
          Mobile
        </button>
        <button type="button" className="btn btn-orange rounded-pill">
          Mobile
        </button>
        <button type="button" className="btn btn-orange rounded-pill">
          Mobile
        </button>
      </div>

      <div className="container py-4">
        <div className="row">
          <div className="col-4">
            <Link to={"/"} className="card">
              <img className="card-img-top" src={mobile} alt="" />
              <div className="card-body">
                <h4 className="card-title">Card title</h4>
                <p className="card-text">
                  This is a wider card with supporting text below as a natural
                  lead-in to additional content. This content is a little bit
                  longer.
                </p>
                <p className="card-text">
                  <small className="text-muted">Last updated 3 mins ago</small>
                </p>
              </div>
            </Link>
          </div>
          <div className="col-4">
            <Link to={"/"} className="card">
              <img className="card-img-top" src={mobile} alt="" />
              <div className="card-body">
                <h4 className="card-title">Card title</h4>
                <p className="card-text">
                  This is a wider card with supporting text below as a natural
                  lead-in to additional content. This content is a little bit
                  longer.
                </p>
                <p className="card-text">
                  <small className="text-muted">Last updated 3 mins ago</small>
                </p>
              </div>
            </Link>
          </div>
          <div className="col-4">
            <Link to={"/"} className="card">
              <img className="card-img-top" src={mobile} alt="" />
              <div className="card-body">
                <h4 className="card-title">Card title</h4>
                <p className="card-text">
                  This is a wider card with supporting text below as a natural
                  lead-in to additional content. This content is a little bit
                  longer.
                </p>
                <p className="card-text">
                  <small className="text-muted">Last updated 3 mins ago</small>
                </p>
              </div>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}
